import React from 'react';
import styled from 'styled-components';
import CommonEmailInput from '../Common/CommonEmailInput';

const Faq = () => {
    return (
        <>
            <FaqContainer>
                <div className="container-fluid p-5">
                    <div className="row">
                        <h1 className="text-center">Frequently Asked Questions</h1>
                            <div className="acc">
                                <div className="acc-title text-center d-flex">
                                    <h3>What is Netfliex</h3><i className="fas fa-times"></i>
                                </div>
                            </div>
                        <div className="email">
                            <CommonEmailInput />
                        </div>
                    </div>
                </div>
            </FaqContainer>
        </>
    )
}

const FaqContainer = styled.div`
    border-top:10px solid gray;
    .acc{
        background:red;
        width:max-content;
        margin:0px auto;
        .acc-title{
        width:100%;
        justify-content:space-between;
        align-items:center;
    }
    }
`

export default Faq
